import React, { useState } from 'react';
import "../src/css/contact.css";
import Navbar from "./components/navbar";
import Footer from "./components/footer";

export default function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    subject: '',
    message: ''
  });

  const [errors, setErrors] = useState({
    name: '',
    phone: '',
    email: '',
    subject: '',
    message: ''
  });

  const validateForm = () => {
    // Validation logic for name (no numbers allowed)
    if (/^\d+$/.test(formData.name)) {
      setErrors(prevErrors => ({
        ...prevErrors,
        name: 'Name cannot contain numbers.'
      }));
    } else {
      setErrors(prevErrors => ({
        ...prevErrors,
        name: ''
      }));
    }

    // Validation logic for phone (max 12 characters, can have letters or symbols)
    if (formData.phone.length > 12) {
      setErrors(prevErrors => ({
        ...prevErrors,
        phone: 'Phone number cannot exceed 12 characters.'
      }));
    } else {
      setErrors(prevErrors => ({
        ...prevErrors,
        phone: ''
      }));
    }

    // Validation logic for subject (less than 20 characters, no special characters)
    if (formData.subject.length > 20 || /[!@#$%^&*(),.?":{}|<>]/.test(formData.subject)) {
      setErrors(prevErrors => ({
        ...prevErrors,
        subject: 'Subject must be less than 20 characters and cannot contain special characters.'
      }));
    } else {
      setErrors(prevErrors => ({
        ...prevErrors,
        subject: ''
      }));
    }

    // Validation logic for other fields as needed
  };

  const validateAndSubmit = () => {
    validateForm();
    // Check if there are no errors before submitting
    if (Object.values(errors).every(error => error === '')) {
      // Perform form submission logic here
      console.log("Form submitted successfully!");
    } else {
      console.log("Form has errors. Please correct them.");
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  return (
    <>
      <Navbar />
      <main>
        <div id="formcontact">
          <form
            id="contactForm"
            onSubmit={(e) => {
              e.preventDefault();
              validateAndSubmit();
            }}
            action="https://formspree.io/f/xwkdywrd"
            method="POST"
            name="myform"
          >
            <div className="containercont">
              <h1>Reach Out to Us. </h1>
              <h1>We Are Just a Message Away!</h1>
              <br />
              <div className="contact-box">
                <div className="contact">
                  <h2>Write Your Request</h2>
                  <br />
                  <label htmlFor="name">Name:</label>
                  <input
                    type="text"
                    id="name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                  <span id="nameError" className="error-message">
                    {errors.name}
                  </span>
                  <label htmlFor="phone">Phone:</label>
                  <input
                    id="phone"
                    type="number"
                    name="phone"
                    placeholder="000 000 0000"
                    value={formData.phone}
                    onChange={handleChange}
                    required
                  />
                  <span id="phoneError" className="error-message">
                    {errors.phone}
                  </span>
                  <label htmlFor="email">Email:</label>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                  <span id="emailError" className="error-message">
                    {errors.email}
                  </span>
                  <label htmlFor="subject">Subject:</label>
                  <input
                    type="text"
                    name="subject"
                    placeholder="Title"
                    value={formData.subject}
                    onChange={handleChange}
                    required
                  />
                  <span id="subjectError" className="error-message">
                    {errors.subject}
                  </span>
                  <label htmlFor="message">Message:</label>
                  <textarea
                    id="message"
                    name="message"
                    rows={4}
                    value={formData.message}
                    onChange={handleChange}
                    required
                  />
                  <span id="messageError" className="error-message">
                    {errors.message}
                  </span>
                  <button
                    type="submit"
                    className="send"
                    id="contact"
                  >
                    SEND
                  </button>
                </div>
              </div>
            </div>
          </form>
        </div>
      </main>
      <Footer />
    </>
  );
}












